const Part =(part)=>{
  console.log(part)
  return(
    <div>
      <p>{part.part.name} {part.part.exercises}</p>
    </div>
  )
}

const Header =(head)=>{
  return(
    <div>
      <h1>{head.course}</h1>
    </div>
  )
}

const Content =(items)=>{
  return(
    <div>
      <Part part={items.items[0]}/>
      <Part name={items.items[1].name} exercises={items.items[1].exercises}/>
      <Part name={items.items[2].name} exercises={items.items[2].exercises}/>
    </div>
  )
}

const Total =(parts)=>{
  return(
    <div>
        <p>
          Number of exercises {parts.parts[0].exercises + parts.parts[1].exercises +parts.parts[2].exercises}
        </p>
    </div>
  )
}

const App =()=> {
  const course = {
    name: "Half Stack application development",
    parts: [
      {
        name: "Fundamentals of React",
        exercises: 10
      },
      {
        name: "Using props to pass data",
        exercises: 7
      },
      {
        name: "State of a component",
        exercises: 14
      }
    ]
  }

  return (
    <div>
      <Header course={course.name}/>
      <Content items={course.parts}/>
      <Total parts={course.parts} />
    </div>
  );
}

export default App
